import React from 'react'
import Footer from 'src/components/Footer/Footer'
import Header from 'src/components/Header/Header'

export default function PurchaseLayout({ children }) {
  return (
    <div className="container">
      <Header />
      {children}
      <Footer />
    </div>
  )
}
